import React, { Component } from 'react'
import Layout from '../components/layout.js'
import { Jumbotron, Button, Media } from 'reactstrap'
import 'bootstrap/dist/css/bootstrap.min.css'

const AvatarStyle = {
    display: 'inline',
    width: '350px',
    height: '350px'
};

const Example = (props) => {
    return (
      <div>
        <Jumbotron>
          <h1 className="display-3 text-center">Welcome to my page!</h1>
          <Media middle img-responsive img-circle margin>
              <Media  object src="../static/images/avatar.jpg" alt="Avatar"></Media>
          </Media>
          <p className="lead">
                This page has been created during my efforts to learn JavaScript 
                and the React development structure.
          </p>
          <hr className="my-2" />
          <p>
                It is my intent to use this page as a professional page and portfolio as
                I progress as a developer.<br />
                Please feel free to look around and email me with any questions or suggestions.
            </p>
          
        </Jumbotron>
      </div>
    );
  };


const pStyle = {
    marginRight: 'Auto',
    marginLeft: 'Auto',
    lineHeight: 3,
    width: '800px',
}

class Home extends Component {
    render() {
        return (
            <Layout>
                <div>
                <Example />
                
                </div>
            </Layout>
        )
    }
}


export default Home;
